INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 5118061, "ペコリーヌとの出会い", 1, 0, 0, "青空の下で謁見", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 7, "フリーマーケット会場", 10118, 2, 2834, 91002, 40);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 5118062, "マホとの出会い", 1, 0, 0, "未来の騎空団\nマスコット？", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 7, "フリーマーケット会場", 10118, 2, 2835, 91002, 40);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 5118063, "アキノとの出会い", 1, 0, 0, "お嬢さまからの\n緊急依頼", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 7, "ランドソル市街地", 10118, 2, 2837, 91002, 40);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 5118064, "ジュンとの出会い", 1, 0, 0, "黄金色の悩みごと", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 18, "フリーマーケット会場", 10118, 2, 4108402, 91002, 40);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 5118065, "カオリとの出会い", 1, 0, 0, "白熱！　格闘大会！", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 18, "フリーマーケット会場", 10118, 2, 4107402, 91002, 40);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 5118066, "ニノンとの出会い", 1, 1, 0, "祭り太鼓はオーエドの華", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 16, "オーエド町", 10118, 2, 9000227, 91002, 40);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 5118067, "スズナとの出会い", 1, 0, 0, "人気者は遅れて\nやってくる", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 19, "フリーマーケット会場", 10118, 3, 2101181, 91002, 40);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 5118068, "ナナカとの出会い", 1, 0, 0, "巫女・ミーツ・魔法少女", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 18, "ランドソル市街地", 10118, 3, 4109402, 91002, 40);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 5118069, "キャル＆コッコロとの出会い", 1, 0, 0, "ネズ耳は二度なくなる", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 18, "フリーマーケット会場", 10118, 3, 4305402, 91002, 40);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 5118070, "ユカリとの出会い", 1, 0, 0, "この出会いにカンパイ！", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 18, "ランドソル市街地", 10118, 3, 4101402, 91002, 40);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 5118071, "アオイとの出会い", 1, 0, 0, "陰陽アンサンブル", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 18, "ランドソル市街地", 10118, 3, 4106402, 91002, 40);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 5118072, "シノブとの出会い", 1, 1, 0, "運試し十番勝負！", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 7, "フリーマーケット会場", 10118, 3, 2836, 91002, 40);
